-- Unit test for [sqids].[IntToId].
-- The test passes when all rows have a 1 in the Is Match column.

DECLARE @alphabet AS [sqids].[IntCharTable]

DECLARE @tests TABLE (Number INT, Id NVARCHAR(MAX))

SELECT
	Number,
	Id,
	[Sqids].[IntToId](Number, @alphabet) [Calculated Id],
	CASE WHEN Id = [Sqids].[IntToId](Number, @alphabet) THEN 1 ELSE 0 END [Is Match]
FROM @tests